  (12331,1901,NULL,2,1926,128736,'Vah Naboris','The Divine Beast Vah Naboris resembles a camel. Its element is thunder. The &quot;humps&quot; are actually powerful lightning generators, which it uses to protect itself. The interior of the Divine Beast is split into three cylinders, each of which can rotate a full 360 degrees. The center cylinder contains the Main Control unit on one side of a platform, and a Sheikah power source on the other side. Urbosa states that Naboris is named after Nabooru, the Sage of Spirit',16.625,-168.375,0,0,'',0,'2021-04-23 18:01:20'),
  (12332,1901,NULL,2,1926,128736,'Vah Rudania','The Divine Beast Vah Rudania resembles a salamander. Its element is fire. It has four compartments near each of its legs that store Guardian Sentries. Rudania can climb vertically like an actual salamander, and doing this rotates the interior of the Divine Beast by 90 degrees. The Main Control Unit is located on the top deck, in the center of the Beast&#039;s back. Its name, Rudania, is an anagram of Darunia, the Sage of Fire.',167.5625,-87.5,0,0,'',0,'2021-04-23 18:01:55'),
  (12333,1901,NULL,2,1901,128736,'Vah Medoh','The Divine Beast Vah Medoh resembles an eagle. It represents the element of wind. To protect itself, it uses a force shield maintained by four generators - one on each wing, one near its head, and one near its tail. The middle section, the wings, can tilt side to side. This is normally used to help Medoh turn in the air, but it also re-orients the interior of the Divine Beast. The Main Control Unit is located on the top deck, between the Beasts wings. While the other Divine Beasts are named after Sages, the namesake of Medoh is less clear. With its pilot being a Rito, it may be named after Medli, the Rito Sage of Earth.',71.5625,-99.9375,0,0,'',0,'2021-04-23 18:02:23'),
